package uniqopeator;

public class LogicalAndOperatorEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=20;
		int b=30;
		int c=40;
		int d=15;
		if((a>b)&&(c>d)) {
			System.out.println("hari");
		}
		else if((a<b)&&(c>d)) {
			System.out.println("siva");
		}
	}

}
